import React, { useState } from "react";
import "./App.css";

function App() {
  const [tripData, setTripData] = useState({
    name: "",
    from_city: "",
    destination_country: "",
    start_date: "",
    duration_days: "",
    budget_inr: "",
    interests: "",
  });

  const [plan, setPlan] = useState(null);
  const [loading, setLoading] = useState(false);
  const [darkMode, setDarkMode] = useState(false);

  const handleChange = (e) => {
    setTripData({ ...tripData, [e.target.name]: e.target.value });
  };

  const toggleTheme = () => {
    setDarkMode((prev) => !prev);
    document.body.classList.toggle("dark-mode");
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setPlan(null);

    try {
      const response = await fetch("http://localhost:8000/plan_trip", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({
          ...tripData,
          interests: tripData.interests
            .split(",")
            .map((i) => i.trim())
            .filter((i) => i),
        }),
      });
      if (!response.ok) {
        throw new Error(`Server error: ${response.status}`);
      }
      const data = await response.json();
      setPlan(data.plan);
    } catch (error) {
      console.error("Error fetching plan:", error);
      alert("Sorry, we couldn't generate your plan. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="App">
      <nav className="navbar">
        <h1 className="logo">✈️ AI Trip Planner</h1>
        <button className="toggle" onClick={toggleTheme}>
          {darkMode ? "🌞" : "🌙"}
        </button>
      </nav>

      <header className="hero">
        <h1>🌏 Plan Your Dream Trip</h1>
        <p>Let AI craft your perfect adventure</p>
      </header>

      <form onSubmit={handleSubmit} className="form">
        {Object.entries(tripData).map(([key, value]) => (
          <input
            key={key}
            type={key.includes("date") ? "date" : "text"}
            name={key}
            value={value}
            placeholder={key.replace(/_/g, " ")}
            onChange={handleChange}
            required
          />
        ))}
        <button type="submit" disabled={loading}>
          {loading ? "Planning..." : "📍 Plan My Trip"}
        </button>
      </form>

      {loading && <p className="loading">⏳ Planning your dream trip...</p>}

      {plan && (
        <div className="plan-output">
          <h2 className="section-title">🧳 Your AI Trip Plan</h2>

          <div className="section">
            <h3>🛫 Flights</h3>
            <div className="card">{plan.flights}</div>
          </div>

          <div className="section">
            <h3>🏨 Hotels</h3>
            <div className="card">{plan.hotels}</div>
          </div>

          <div className="section">
            <h3>🗓️ Itinerary</h3>
            <div className="card">{plan.itinerary}</div>
          </div>

          <div className="section">
            <h3>🛂 Visa Info</h3>
            <div className="card">{plan.visa}</div>
          </div>
        </div>
      )}

      <footer className="footer">
        <p>🚀 Built with 💙 by your AI Travel Agent</p>
      </footer>
    </div>
  );
}

export default App;
